class Element:
    def __init__(self, Z: int, mass: float, name: str, state: str, bonding:str, 
                 ElectronicConfiguration: str, Electronegativity: float, density: float,
                 IonizationEnergy: float, AtomicRadius: float, ElectronAffinity: float):
        self.Z = Z
        self.mass = mass
        self.name = name
        self.state = state
        self.bonding = bonding
        self.ElectronicConfiguration = ElectronicConfiguration
        self.Electronegativity = Electronegativity
        self.density = density    
        self.IonizationEnergy = IonizationEnergy
        self.AtomicRadius = AtomicRadius
        self.ElectronAffinity = ElectronAffinity

    def molar_density(self) -> float:
        molar_mass = self.mass #because 1u = g/mol
        return self.density / molar_mass
    
    def mass_for_mol(self, moles: float) -> float:
        molar_mass = self.mass
        return moles * molar_mass

